import React, { useEffect, useState } from 'react';

export default function ListeEnchere() {

  const fo = async(e) => {
    //console.log("ato");
    window.location.replace('/FicheEnchere');
  }

  return (
    <>
    <h2>Liste des Enchere en cours</h2>
    <form>
      <button type="submit" onClick={fo}>Detail</button>
    </form>
    </>
  );
}
